import base64
import os

# --- INSTRUCCIONES ---
# 1. PEGA AQU√ç la cadena Base64 COMPLETA que te devuelve la API
BASE64_STRING = ""
# 2. Define el nombre del archivo de salida
OUTPUT_FILENAME = "factura_decodificada_TEST.pdf"
# ---------------------

def decodificar_y_guardar(base64_data: str, output_path: str):
    """Decodifica la cadena Base64 y la guarda como un archivo binario (PDF)."""
    
    if not base64_data:
        print("Error: La cadena Base64 est√° vac√≠a.")
        return

    try:
        # 1. Decodificar la cadena Base64 a datos binarios (bytes)
        pdf_bytes = base64.b64decode(base64_data)
        
        # 2. Guardar los datos binarios en un archivo
        with open(output_path, 'wb') as f:
            f.write(pdf_bytes)
            
        print(f"\n‚úÖ ¬°Decodificaci√≥n exitosa!")
        print(f"   El archivo ha sido guardado como: {os.path.abspath(output_path)}")
        print(f"   Verifica que se abre correctamente como un PDF original.")
        
    except base64.binascii.Error as e:
        print(f"\n‚ùå ERROR DE DECODIFICACI√ìN: La cadena Base64 es inv√°lida o est√° incompleta.")
        print(f"   Detalle: {e}")
    except Exception as e:
        print(f"\n‚ùå Error inesperado: {e}")

if __name__ == "__main__":
    # --- IMPORTANTE: Reemplaza la variable BASE64_STRING con tu contenido real ---
    decodificar_y_guardar(BASE64_STRING, OUTPUT_FILENAME)